import './jogos.css'
import { Celula } from '../../models/bingo/celula';
import Select from 'react-select';
import { useState } from 'react';

function Jogos() {


  const [x3, setx3] = useState(false);
  const [x4, setx4] = useState(false);
  const [x5, setx5] = useState(false);
  const [classe, setClasse] = useState("x3");

  function countLines() {
    let texto = document.getElementById("inputBingo").value;
    var lines = texto.split("\n");
    var count = lines.length;
    console.log(count);
    console.log(lines[0]);

    if (count <= 9) {
      let div3 = document.getElementById("x3div");
      let cell1 = document.createElement("Celula")
      cell1.innerText = lines[0];
      let cell2 = document.createElement("Celula")
      cell2.innerText = lines[1];
      let cell3 = document.createElement("Celula")
      cell3.innerText = lines[2];
      let cell4 = document.createElement("Celula")
      cell4.innerText = lines[3];
      let cell5 = document.createElement("Celula")
      cell5.innerText = lines[4];
      let cell6 = document.createElement("Celula")
      cell6.innerText = lines[5];
      let cell7 = document.createElement("Celula")
      cell7.innerText = lines[6];
      let cell8 = document.createElement("Celula")
      cell8.innerText = lines[7];
      let cell9 = document.createElement("Celula")
      cell9.innerText = lines[8];
      div3.appendChild(cell1);
      div3.appendChild(cell2);
      div3.appendChild(cell3);
      div3.appendChild(cell4);
      div3.appendChild(cell5);
      div3.appendChild(cell6);
      div3.appendChild(cell7);
      div3.appendChild(cell8);
      div3.appendChild(cell9);
      setx3(true)
      setx4(false)
      setx5(false)
      setClasse("x3");
    };
    if (count > 9 && count <= 16) {
      setx3(false)
      setx4(true)
      setx5(false)
      setClasse("x4");
    }
    if (count > 16 && count <= 25) {
      setx3(false)
      setx4(false)
      setx5(true)
      setClasse("x5");
    }
  }


  return (
    <div className="jogos">
      <div id='bingo' className={classe}>
        <div id="x3div" className={x3 ? "Aparece" : "escondido"}>
          <Celula id="x31"></Celula>
          <Celula id="x32"></Celula>
          <Celula id="x33"></Celula>
          <Celula id="x34"></Celula>
          <Celula id="x35"></Celula>
          <Celula id="x36"></Celula>
          <Celula id="x37"></Celula>
          <Celula id="x38"></Celula>
          <Celula id="x39"></Celula>
        </div>
        <div id="x4div" className={x4 ? "Aparece" : "escondido"}>
          <Celula id="x41"></Celula>
          <Celula id="x42"></Celula>
          <Celula id="x43"></Celula>
          <Celula id="x44"></Celula>
          <Celula id="x45"></Celula>
          <Celula id="x46"></Celula>
          <Celula id="x47"></Celula>
          <Celula id="x48"></Celula>
          <Celula id="x49"></Celula>
          <Celula id="x410"></Celula>
          <Celula id="x411"></Celula>
          <Celula id="x412"></Celula>
          <Celula id="x413"></Celula>
          <Celula id="x414"></Celula>
          <Celula id="x415"></Celula>
          <Celula id="x416"></Celula>
        </div>
        <div id="x5div" className={x5 ? "Aparece" : "escondido"}>
          <Celula id="x51"></Celula>
          <Celula id="x52"></Celula>
          <Celula id="x53"></Celula>
          <Celula id="x54"></Celula>
          <Celula id="x55"></Celula>
          <Celula id="x56"></Celula>
          <Celula id="x57"></Celula>
          <Celula id="x58"></Celula>
          <Celula id="x59"></Celula>
          <Celula id="x510"></Celula>
          <Celula id="x511"></Celula>
          <Celula id="x512"></Celula>
          <Celula id="x513"></Celula>
          <Celula id="x514"></Celula>
          <Celula id="x515"></Celula>
          <Celula id="x516"></Celula>
          <Celula id="x517"></Celula>
          <Celula id="x518"></Celula>
          <Celula id="x519"></Celula>
          <Celula id="x520"></Celula>
          <Celula id="x521"></Celula>
          <Celula id="x522"></Celula>
          <Celula id="x523"></Celula>
          <Celula id="x524"></Celula>
          <Celula id="x525"></Celula>
        </div>
      </div>
      <div className='lista'>
        <h1>Jogos</h1>
        <h3>Conteudo do bingo, 1 linha = 1 quadrado</h3>
        <textarea id='inputBingo' onChange={countLines} />
      </div>
    </div >

  );

}


export default Jogos;
